import React from 'react';
import './App.css'; // Asegúrate de tener tus estilos CSS importados

import Stock from './Stock'; // Importa tu componente Stock
import Product from './Product'; // Importa tu componente Product
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Importa las utilidades de enrutamiento

function App() {
  return (

    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={Stock} />
          <Route path="/products/:id" component={Product} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
